date: Mar 2024
place: on the south side of Pulau Andau kecil about at the height of the Andau resort. Morning snorkeling, and mainly for manta rays as there is little corals here on this side.
You need a boat to get here as usual in Misool/Raja Ampat; potentially snorkelable from the Andau resort.

