date: Apr 2021
place: This white golden sand bowl shaped beach can be reached from Naku by walking down a lot of stairs, crossing a river (will be solved once the road from Hukurila to Seri is finished), and another flat path to the beach. This sheltered bay is also good for swimming, and here the boat parking is behind the beach, which makes the swimming in front of the beach more relaxing.
Free access to the beach. Snorkeling to the right side and in front of the beach is not rewarding.

Getting here: Take an angkot to Kilang/Hukurila and get out in Naku; 10k/person till here (a very clean old style village). Take the main road of Naku and walk it down to the beach

