date: Nov 2013
place: mostly hard corals, but not in a good state here - snorkeling interrupted by rain; reports show mixed coral quality, depending on the spot on the reef, and the presence of strong currents.

Getting here: rent a boat from Banda (300-500k) - typically you can visit this island in combination going to pulau Hatta on a day trip. There should be also a public boat (20k/person) - given the size of the village on the island it is unlikely to go every day. There should be one guesthouse on the island (Mailena guesthouse), but it is dormant and only opens on demand

